import React from "react";
import DataTable from "react-data-table-component";

function Table() {
  const column = [
    {
      name: <h1>S.No</h1>,
      width: "60px",
      cell: (row, index) => <div className="text-[#6D6D6D]">{index + 1}</div>,
    },
    {
      name: <h1>Name</h1>,
      width: "60px",
      cell: (row, index) => <div className="text-[#6D6D6D]">Ganesh</div>,
    },
    {
      name: <h1>Start Time</h1>,
      width: "60px",
      cell: (row, index) => <div className="text-[#6D6D6D]">12:00</div>,
    },
    {
      name: <h1>End Time</h1>,
      width: "60px",
      cell: (row, index) => <div className="text-[#6D6D6D]">02:00</div>,
    },
  ];
  return (
    <div className="w-[95%] bg-red-500">
      <DataTable
        // key={column}
        columns={column}
        // data={data}
        // customStyles={tableCustomStyles}
        highlightOnHover
        pagination
      ></DataTable>
    </div>
  );
}

export default Table;

